import Header from "./components/Header";
import {Routes,Route} from 'react-router-dom';
import React from "react";
function App() {
    return (
        <React.Fragment>
            <header>
                <Header/>
            </header>
            <main>
                <Routes>
                    <Route path="/" element={<Home />}></Route>
                </Routes>
            </main>
        </React.Fragment>
    );
}

export default App;
